/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="workers">Workers</h1>\n<p>Workers are proposals to perform a service in return for a salary from the blockchain. A worker proposal contains at a minimum the following information:</p>\n<ul>\n<li>A start and end date</li>\n<li>A daily pay</li>\n<li>A maximum total pay</li>\n</ul>\n<p>It should also contain a link to a webpage where the worker proposal is explained in more detail.</p>\n<p>Votes for worker proposals can be positive or negative, which means you can downvote a proposal that you do not like.</p>\n<h2 id="worker-budget-mechanics">Worker budget mechanics</h2>\n<p>Workers receive pay from a fixed daily budget on a first-come, first-serve basis until there are no more funds left. To see how this works, say we the following:</p>\n<ul>\n<li>A daily total budget of 400k CYB for all workers</li>\n<li>5 worker proposals with a positive votes total, with daily pay requests of 100k CYB each</li>\n</ul>\n<p>Now the four workers with the most votes will all receive 100k CYB each per day, but once they&#39;ve been paid the worker budget is empty. Therefore the fifth worker will receive nothing.</p>\n'},
/*!*****************************************!*\
  !*** ./help/en/introduction/witness.md ***!
  \*****************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="witness">Witness</h1>\n<p>Witnesses are entities that work for the blockchain by constructing new blocks.\nEach witness is approved by the shareholders and constructs and signs blocks\nfrom validated transactions. Every transaction made in the network is required\nto be validated by all witnesses eventually.</p>\n<h2 id="consensus-mechanism">Consensus Mechanism</h2>\n<p>Who exactly is allows to <em>produce</em> a block at which time instant is defined by a\nconsensus mechanism called <em>Delegated Proof of Stake</em>. In essence, the\nshareholders of Cybex (holders of the CYB token) can cast a vote for their\npreferred block producers on the blockchain. Those so called <em>witnesses</em> with\nthe most votes are allowed to produce blocks.</p>\n'},
