/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="wallet">Wallet</h1>\n<p>As you may have noticed already, this application is a web application and runs\nin a browser. A connection is established to a trusted node in the network that\nserves as a gateway to the rest of the ecosystem.</p>\n<h2 id="cloud-wallet">Cloud Wallet</h2>\n<p>If you registered with a username and password, you have a cloud wallet. Although\nnothing is technically stored in the cloud, we user the term Cloud Wallet because\nyou can use these credentials (username and password) from any web browser at any \ntime to gain access to your account. The cloud wallet only allows for a single \naccount to be accessed at a time. This is generally the correct choice for new users. \nWhile it is possible to change the auto-generated password, we do not recommend\ndoing so at this time. The team is working on a responsible way to manage the\npassword change that requires no technical knowledge. We will make an announcement\nonce it&#39;s released.</p>\n<h2 id="local-wallet">Local Wallet</h2>\n<p>The local wallet creates a database within your browser. This means that access\nto your funds it tied to <strong>that browser only</strong>. If you attempt to access your\nlocal wallet from any other computer, or any other browser, it will fail unless\nyou actively import your backup file from the original browser backup file. The\nprocess actually easy. See managing <a href="/help/introduction/backups">backups</a>.</p>\n<h2 id="security">Security</h2>\n<p>Rest assured that our servers do not have access to your funds because none of\nyour private keys ever leave your browser. Instead, they are encrypted with your\npassphrase and are stored in your local browser&#39;s database. As such, you should\nmake sure to have a proper <a href="../introduction/backups.md">Backup</a> in the event\nsomething happens to your computer or browser.</p>\n<h2 id="management">Management</h2>\n<p>The user interface is capable of carrying and accessing several\nseparated wallets each containing possible several accounts and corresponding\nfunds. You can create, backup, and switch existing wallets in <code>Settings-&gt;Wallets</code>.</p>\n'},
