/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="trading">Trading</h1>\n<p>This page will give a very quick introduction on how to interpret the terms used\nby the DEX and how trading pairs are presented.</p>\n<h2 id="pairs">Pairs</h2>\n<p>In Cybex, almost any asset can be traded with all other assets. Once we have\npicked two assets, we usually refer to a <em>market pair</em>. For instance, we can\ntrade USD against EUR in the USD:EUR pair.</p>\n<p>For sake of consistency, we will use the generalized terms <em>base</em> and <em>quote</em>\nsuch that pairs are represented as</p>\n<pre><code>*quote* : *base*</code></pre><p>and for instance with <em>base</em> being USD and <em>quote</em> being EUR, denote the EUR:USD\npair.</p>\n<h2 id="order-books">Order Books</h2>\n<p>The order book consists of an <em>ask</em> and a <em>bid</em> side. Since trading pairs do not\nhave a preferred orientation, and can be flipped, the following table shall give\nan overview of ask/bid and the corresponding buy/sell operations for each side:</p>\n<table>\n<thead>\n<tr>\n<th>Side</th>\n<th>Sell</th>\n<th>Buy</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Ask</td>\n<td><em>quote</em></td>\n<td><em>base</em></td>\n</tr>\n<tr>\n<td>Bid</td>\n<td><em>base</em></td>\n<td><em>quote</em></td>\n</tr>\n<tr>\n<td>----------</td>\n<td>-------</td>\n<td>-------</td>\n</tr>\n</tbody></table>\n<p>Obviously, what is on the bid side of the USD:EUR pair will be on the ask side\non the EUR:USD pair. Of course prices are internally represented as fractions,\nand thus results in both pairs being identical.</p>\n<h2 id="trading">Trading</h2>\n<p>To place a trading order, it is required to fill the form on either the <em>ask</em> or\nthe <em>bid</em> side (respectively, <em>buy</em> or <em>sell</em> side). You will need to define\na <em>price</em> and an <em>amount</em> to sell/buy. The cost for this order will be\ncalculated automatically. Note that there will be an additional fee required to\nactually place the order.</p>\n<p>Once the order is filled (i.e. someone sold/bought your offer), your account\nwill be credited by the corresponding asset.</p>\n<p>Unfilled orders can be canceled at any time.</p>\n'},
/*!*********************************!*\
  !*** ./help/en/dex/shorting.md ***!
  \*********************************/
