/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="short-selling-bitassets">Short Selling BitAssets</h1>\n<p>In order to increase your exposure to CYB and offer liquidity to BitAssets, such\nas USD, EUR, GOLD, etc., you can go <em>borrow</em> this bitAsset from the network and\n<em>sell it short</em>. We will here briefly describe the procedure.</p>\n<h2 id="borrowing">Borrowing</h2>\n<p>The Cybex network is capable of issuing any amount of any BitAsset and lend\nit out to participants given enough collateral.</p>\n<ul>\n<li><em>settlement price</em>: The price for 1 CYB as it is traded on external exchanges.</li>\n<li><em>maintenance collateral ratio</em> (MCR): A ratio defined by the witnesses as minimum required collateral ratio</li>\n<li><em>maximum short squeeze ratio</em> (MSQR): A ratio defined by the witnesses as to how far shorts are protected against short squeezes</li>\n<li><em>short squeeze protection</em> (SQP): Defines the most that a margin position will ever be forced to pay to cover </li>\n<li><em>call price</em> (CP): The price at which short/borrow positions are margin called</li>\n</ul>\n<h3 id="margin-call">Margin Call</h3>\n<p>The Cybex network is capable of margin calling those positions that do not\nhave enough collateral to back their borrowed bitAssets. A margin call will\noccur any time the highest bid is less than the <em>call price</em> and greater than\n<em>SQP</em>.\nThe margin position will be forced to sell its collateral anytime the highest\noffer to buy the collateral is less than the call price (x/CYB).</p>\n<pre><code>SQP = settlement price / MSQR\ncall price = DEBT / COLLATERAL * MCR</code></pre><p>The margin call will take the collateral, buy shares of borrowed bitAsset at\nmarket rates up to the SQP and close the position. The remaining CYB of the\ncollateral are returned to the customer.</p>\n<h3 id="settlement">Settlement</h3>\n<p>Holders of any bitAsset can request a settlement at a <em>fair price</em> at any time.\nThe settlement closes the borrow/short positions with lowest collateral ratio\nand sells the collateral for the settlement.</p>\n<h2 id="selling">Selling</h2>\n<p>After borrowing bitAssets, they can be sold free at any of the corresponding\nmarkets at any price a buyer is willing to pay. With this step, the\nshort-selling is now complete and you are short that particular bitAsset.</p>\n<h2 id="updating-collateral-ratio">Updating Collateral Ratio</h2>\n<p>At any time, the holder of a borrow/short position can modify the collateral\nratio in order to flexibly adjust to market behavior. If the collateral ratio is\nincrease, an additional amount of CYB is locked as collateral, while reducing\nthe collateral ratio will require an amount of the corresponding BitAsset to be\npayed back to the network.</p>\n<h2 id="covering">Covering</h2>\n<p>To close a borrow/short position, one must hold the borrowed amount of that\nparticular bitAsset to hand it over to the Cybex network. After that, the\nBitAssets are reduced from the corresponding supply and the collateral is\nreleased and given back to its owner.</p>\n'},
