/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="decentralized-exchange">Decentralized Exchange</h1>\n<p>The decentralized exchange (further denoted simply as <em>the DEX</em>) allows for\ndirect exchange of digital goods traded in the Cybex ecosystem.</p>\n<p>A decentralized exchange has a very particular set of advantages over\ntraditional centralized exchanges and we would like to address some of them\nbriefly below. Although the Cybex DEX comes with all of them, it is up to\nthe reader and customer to leverage those features in full or only partially.</p>\n<ul>\n<li><p><strong>Separation of Powers</strong>: \nThere is no reason why the same entity needs to be responsible for\nissuing IOUs and for processing the order book. In Cybex, order matching\nis performed by the protocol, which is unaware of implications concerning the\ninvolved assets.</p>\n</li>\n<li><p><strong>Global Unified Order Book</strong>:\nSince Cybex is global, anybody with an internet access can use the DEX for\ntrading. This brings the world&#39;s liquidity to a single order book for\ndecentralized trading.</p>\n</li>\n<li><p><strong>Trade Almost Anything</strong>:\nThe Cybex DEX is asset agnostic. Hence you can trade at <strong>any</strong> pair.\nWhile some pairs may end up with low liquidity, such as SILVER:GOLD, other\npairs such as USD:EUR for FOREX trading will see huge volume.</p>\n</li>\n<li><p><strong>No Limits</strong>:\nThe Cybex protocol is unable to limit your trading experience.</p>\n</li>\n<li><p><strong>Decentralized</strong>:\nThe DEX is decentralized across the globe. This not only means that there is\nno single point of failure, but it also implies that the Cybex exchange is\nopen for trading 24/7 because it&#39;s always daytime somewhere.</p>\n</li>\n<li><p><strong>Secure</strong>:\nYour funds and trades are secured with industry-grade elliptic curve\ncryptography. No one will be able to access your funds unless you let them. To\nfurther strengthen the security, we allow our customers to setup escrow and\nmulti-signature schemes.</p>\n</li>\n<li><p><strong>Fast</strong>:\nIn contrast to other decentralized networks, the Cybex DEX allows for\nreal-time trading and is only limited by the speed of light and the size of\nthe planet.</p>\n</li>\n<li><p><strong>Provable Order Matching Algorithm</strong>:\nWhat makes the Cybex DEX unique is the provable order matching algorithm.\nGiven a set of orders, you will always be able to provably verify that these\norders have been matched properly.</p>\n</li>\n<li><p><strong>Collateralized Smartcoins</strong>:\nOne of the biggest features of Cybex are its <em>smartcoins</em> such as bitUSD,\nbitEUR, bitCNY, and others. For the sake of convenience, these assets are\ndenotes simply as USD, EUR, CNY, etc. in the wallet. These digital tokens\nrepresent the same value as their underlaying physical asset. Hence 1 USD in\nthis wallet is worth $1 and can be redeemed as such. Any of these tokens is\nbacked by Cybex&#39; company shares (CYB) being locked up as collateral and\nbeing available for settlement at its current price.</p>\n</li>\n</ul>\n'},
