/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>Update your {debt} margin position by adjusting the debt and collateral levels.</p>\n<p>Collateral and debt levels can be adjusted in any way you desire, as long as your collateral ratio stays above the maintenance collateral ratio of {mr}. <a href="dex/shorting">Read more.</a></p>\n'},
/*!****************************************************!*\
  !*** ./help/en/components/AccountVotingWorkers.md ***!
  \****************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p><a href="introduction/workers">Workers</a> are a unique concept to Cybex. They are proposals to provide services in return for a salary from the blockchain itself. A proposal should include a link to a website or forum thread that explains the purpose of the proposal, a collection of proposals can be found here: <a href="https://Cybextalk.org/index.php/board,75.0.html">Cybextalk - Stakeholder Proposals Board</a>.</p>\n'},
/*!******************************************************!*\
  !*** ./help/en/components/AccountVotingWitnesses.md ***!
  \******************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p><a href="introduction/witness">Witnesses</a> are the block producers of Cybex. They validate transactions and ensure the safety of the network. You may vote for as many witnesses as you&#39;d like, and they will all receive the same amount of votes. Witness proposals can be found here: <a href="https://Cybextalk.org/index.php/board,75.0.html">Cybextalk - Stakeholder Proposals Board</a>.</p>\n'},
/*!**************************************************!*\
  !*** ./help/en/components/AccountVotingProxy.md ***!
  \**************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>If you don&#39;t fully understand the roles of Witnesses, Committee Members and Workers, you may elect to choose a Proxy. A proxy is an account that you trust to make decisions about the Cybex network on your behalf. You may find people proposing to act as proxies in the Cybex forum at <a href="https://Cybextalk.org/index.php/board,75.0.html">Cybextalk</a>. Additionally, you may choose from the list below, or you can manually enter any account you choose.</p>\n<p><strong>Be sure to select publish changes above once you&#39;ve made your selection</strong>.</p>\n'},
/*!******************************************************!*\
  !*** ./help/en/components/AccountVotingCommittee.md ***!
  \******************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p><a href="introduction/committee">Committee members</a> may propose changes to the dynamic parameters of the blockchain, such as fees, block time and many other things. It is a position of great responsibility that requires a good understanding of how Cybex works.</p>\n'},
/*!*********************************************!*\
  !*** ./help/en/components/AccountVoting.md ***!
  \*********************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h3 id="voting">Voting</h3>\n<p>Voting in Cybex is important for both the security and the development of the network. Votes determine which Witnesses are selected to handle the network, which Committee Members have the power to vote on important policies and which Worker Proposals are accepted to improve or expand features.</p>\n<p>If you don&#39;t fully understand the various roles listed above, you may choose to delegate your voting power to a Proxy, who can then vote on your behalf. If you do choose to use a Proxy, you will be unable to vote for Witnesses, Committee Members and Worker Proposals. You can always release your proxy at a later date if you decide to participate in the full voting process.</p>\n<p><strong>Be sure to select Publish Changes once you&#39;ve made your selection.</strong></p>\n'},
/*!************************************************!*\
  !*** ./help/en/components/AccountPermOwner.md ***!
  \************************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>Owner permissions define who has control over the account. Owners may overwrite all keys and change any account settings.</p>\n<p>See <a href="accounts/permissions">permissions</a> for more details.</p>\n<p><strong>If you have vesting/lockup balances, please make sure that the don&#39;t remove the permission which the balances belong to. If you remove the public connecting with a vesting/lockup balance, you&#39;ll not be able to claim that balance by any means.</strong></p>\n'},
/*!***********************************************!*\
  !*** ./help/en/components/AccountPermMemo.md ***!
  \***********************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports="<p>The memo key is where you receive memos, in order to decode the memos you need to control the private key for the public key.</p>\n<p>By using a public/private key pair without spending authority, you may give read-only access to your memos to third parties.</p>\n"},
