/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>Active permissions define the accounts that have permission to spend funds for this account.</p>\n<p>They can be used to easily setup a multi-signature scheme, see <a href="accounts/permissions">permissions</a> for more details.</p>\n<p><strong>If you have vesting/lockup balances, please make sure that the don&#39;t remove the permission which the balances belong to. If you remove the public connecting with a vesting/lockup balance, you&#39;ll not be able to claim that balance by any means.</strong></p>\n'},
