/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="market-pegged-assets">Market Pegged Assets</h1>\n<p>A crypto-currency, with the properties and advantages of Bitcoin, that is\ncapable of maintaining price parity with a globally adopted currency (e.g. U.S.\ndollar), has high utility for convenient and censorship resistant commerce. This\ncan be achieved by Cybex&#39; market pegged assets (MPA), a new type of freely\ntraded digital asset whose value is meant to track the value of a conventional\nunderlying asset by means of contracts for difference (CFD). </p>\n<p>A <em>SmartCoin</em> (synonym for MPA) is a crypto-currency that <em>always</em> has 100% or\nmore of its value backed by the Cybex core currency (CYB), to which they can\nbe converted at any time, as <em>collateral</em> in a CFD.</p>\n<p>What makes MPAs unique is that they are free from counterparty risk even though\nthey resemble a CFD backed by collateral. This is achievable by letting the\nnetwork itself (implemented as a software protocol) be responsible for securing\nthe collateral and performing settlements as will be described in more detail\nbelow.</p>\n<p>This is a subset of the available market pegged assets:</p>\n<ul>\n<li>BitUSD</li>\n<li>BitCNY</li>\n<li>BitEUR</li>\n<li>BitGOLD</li>\n<li>...</li>\n</ul>\n'},
