/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>[# summary]</p>\n<h3 id="asset-symbol-">Asset {symbol}</h3>\n<p>{description}</p>\n<p>Issued by: {issuer}</p>\n<p>[# annual]</p>\n<p>If a lifetime membership is too much you can still get {feesCashback}%  cashback for the next year by becoming an\nannual subscriber for just {price} per year.\n<img src="/images/logo.png" alt="GitHub Logo"></p>\n<p>[# fee-division]</p>\n<h4 id="fee-division">Fee Division</h4>\n<p>Every time {account} pays a transaction fee, that fee is divided among several different accounts.  The network takes\na {networkFee}% cut, and the Lifetime Member who referred {account} gets a {lifetimeFee}% cut.</p>\n<p>The <em>registrar</em> is the account that paid the transaction fee to register {account} with the network.  The registrar gets to decide how to\ndivide the remaining {referrerTotalFee}% between themselves and their own <em>Affiliate Referrer</em> program.</p>\n<p>{account}&#39;s registrar chose to share {referrerFee}% of the total fee with the <em>Affiliate Referrer</em> and keep {registrarFee}% of the total fee for themselves.</p>\n<h4 id="pending-fees">Pending Fees</h4>\n<p>Fees paid by {account} are only divided among the network, referrers, and registrars once every maintenance interval ({maintenanceInterval} seconds). The\nnext maintenance time is {nextMaintenanceTime}.</p>\n<h4 id="vesting-fees">Vesting Fees</h4>\n<p>Most fees are made available immediately, but fees over {vestingThreshold}\n(such as those paid to upgrade your membership or register a premium account name) must vest for a total of {vestingPeriod} days.</p>\n'},
