/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="permissions">Permissions</h1>\n<p>In Cybex, each account is separated into</p>\n<ul>\n<li><strong>Active Permission</strong>: control over its funds and</li>\n<li><strong>Owner Permission</strong>: control over the account.</li>\n</ul>\n<p>Both can be defined in the <code>Permissions</code> tab of your account using so called\n<em>authorities</em> (see below) together with a so called <em>threshold</em> that has to be\nexceeded in order for a transaction to be valid.</p>\n<h2 id="authorities">Authorities</h2>\n<p>In Cybex an <em>authority</em> consists of one or many entities that authorize an\naction, such as transfers or trades.</p>\n<p>An authority consists of one or several pairs of an account name with a\n<em>weight</em>.</p>\n<p>In order to obtain a valid transaction, the sum of the weights from signing\nthe parties has to exceed the threshold as defined in the permissions.</p>\n<h1 id="examples">Examples</h1>\n<p>Let&#39;s discuss some examples to shed some light on the used terminology and the\nuse-cases. We assume that a new account is created with it&#39;s active permissions\nset as described below. Note that the same scheme also works for the owner\npermissions!</p>\n<h2 id="-flat-multi-signature">(Flat) Multi-Signature</h2>\n<p>A flat multi-signature scheme is composed of <code>M</code> entities of which <code>N</code> entities\nmust sign in order for the transaction to be valid. Now, in Cybex, we have\n<em>weights</em> and a <em>threshold</em> instead of <code>M</code> and <code>N</code>. Still we can achieve the\nvery same thing with even more flexibility as we will see now.</p>\n<p>Let&#39;s assume, Alice, Bob, Charlie and Dennis have common funds. We want to be\nable to construct a valid transaction if only two of those agree. Hence a\n<strong>2-of-4</strong> (N-of-M) scheme can look as follows:</p>\n<table>\n<thead>\n<tr>\n<th>Account</th>\n<th>Weight</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Alice</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Threshold:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>All four participants have a weight of 33% but the threshold is set to 51%.\nHence only two out of the four need to agree to validate the transaction.</p>\n<p>Alternatively, to construct a 3-of-4 scheme, we can either decrease the weights\nto 17 or increase the threshold to 99%.</p>\n<h2 id="-flat-flexible-multi-signature">(Flat) Flexible Multi-Signature</h2>\n<p>With the threshold and weights, we now have more flexibility over our funds, or\nmore precisely, we have more <em>control</em>. For instance, we can have separate\nweights for different people. Let&#39;s assume Alice wants to secure here funds\nagainst theft by a multi-signature scheme but she does not want to hand over too\nmuch control to her friends. Hence, we create an authority similar to:</p>\n<table>\n<thead>\n<tr>\n<th>Account</th>\n<th>Weight</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Alice</td>\n<td>49%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Threshold:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>Now the funds can either be accessed by Alice and a single friend or by all\nthree friends together.</p>\n<h2 id="multi-hierarchical-flexible-multi-signature">Multi-Hierarchical Flexible Multi-Signature</h2>\n<p>Let&#39;s take a look at a simple multi-hierarchical corporate account setup.  We\nare looking at a company that has a Chief of Financial Officer (CFO) and a some\ndepartments working for him, such as the Treasurer, Controller, Tax Manager,\nAccounting, etc. The company also has a CEO that wants to have spending\nprivileges. Hence we construct an authority for the funds according to:</p>\n<table>\n<thead>\n<tr>\n<th>Account</th>\n<th>Weight</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>CEO.COMPANY</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>CFO.COMPANY</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Threshold:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>whereas CEO.COMPANY and CFO.COMPANY have their own authorities. For instance,\nthe CFO.COMPANY account could look like:</p>\n<table>\n<thead>\n<tr>\n<th>CFO.COMPANY</th>\n<th>Weight</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Chief.COMPANY</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>Treasurer.COMPANY</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Controller.COMPANY</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Tax Manager.COMPANY</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>Accounting.COMPANY</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>-------------------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Threshold:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>This scheme allows:</p>\n<ul>\n<li>the CEO to spend funds</li>\n<li>the Chief of Finance Officer to spend funds</li>\n<li>Treasurer together with Controller to spend funds</li>\n<li>Controller or Treasurer together with the Tax Manager and Accounting to\nspend funds.</li>\n</ul>\n<p>Hence, a try of arbitrary depth can be spanned in order to construct a flexible\nauthority to reflect mostly any business use-case.</p>\n'},
