/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="memberships">Memberships</h1>\n<p>Accounts in Cybex are separated into three groups. We decided to give users\nthe option to upgrade their accounts into a VIP-like status if they desire and\nprofit from reduced fees and additional features.</p>\n<h2 id="non-members">Non-Members</h2>\n<p>A <em>regular</em> account is a <em>non-member</em>.</p>\n<h2 id="lifetime-members">Lifetime Members</h2>\n<p>Lifetime Members get a percentage cashback on every transaction fee they pay\nand income from referrals. A Lifetime membership is associated with a certain one-time fee\ndefined in this <a href="/explorer/fees">schedule</a>.</p>\n<h2 id="annual-members">Annual Members</h2>\n<p>If a lifetime membership is too much you can still get the same cashback for the\nnext year by becoming an annual subscriber for a smaller one-time fee which\nlasts for only one year.</p>\n<h3 id="fee-division">Fee Division</h3>\n<p>Every time an account you referred pays a transaction fee, that fee is divided\namong several different accounts. The network takes a cut, and the Lifetime\nMember who referred the account gets a cut.</p>\n<p>The registrar is the account that paid the transaction fee to register the\naccount with the network. The registrar gets to decide how to divide the\nremaining fee between themselves and their own affiliate.</p>\n<h3 id="pending-fees">Pending Fees</h3>\n<p>Fees paid are only divided among the network, referrers, and registrars once\nevery maintenance interval.</p>\n<h3 id="vesting-fees">Vesting Fees</h3>\n<p>Most fees are made available immediately, but fees over the vesting threshold\n(such as those paid to upgrade your membership or register a premium account\nname) must vest for some period of time as defined by the committee.</p>\n'},
